package com.longfe.parse.sql;import java.util.List;class SelectSqlNode extends SqlNode {	String id;	String parameterType;	List<SqlNode> sqlNodes;	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getParameterType() {		return parameterType;	}	public void setParameterType(String parameterType) {		this.parameterType = parameterType;	}	public List<SqlNode> getSqlNodes() {		return sqlNodes;	}	public void setSqlNodes(List<SqlNode> sqlNodes) {		this.sqlNodes = sqlNodes;	}}